import React from "react";
import ReactDom from "react-dom";
import './index.css'

const firstBook = {
  title : "I love you to the moon and back",
  author : "pratyay gaurav",
  img :
   "https://m.media-amazon.com/images/I/51p2SDOCV9L._SX482_BO1,204,203,200_.jpg"
}

const secondBook = {
  title: "Rich Dad",
  author: "qwerty",
  img: "https://images-eu.ssl-images-amazon.com/images/I/81BE7eeKzAL._AC_UL900_SR900,600_.jpg",
};

const thirdBook = {
  title: "mythology",
  author: "pratyay gaurav",
  img: "https://www.amazon.in/First-Mythology-Tale-Illustrated-Books/dp/9390292964/ref=zg_bs_books_sccl_16/259-8653629-3420252?psc=1",
};

function BookList() {
  return (
    <section className="booklist">
      <Book
        img={firstBook.img}
        title={firstBook.title}
        author={firstBook.author}
      />

      <Book />
      <Book />
    </section>
  );
}


const Book = (props) => {

  return (
  <article className="book">
  <img src={props.img} alt=''/>
  <h1>{props.title}</h1>
  <h4>{props.author}</h4>

  <p>{props.title}</p>
  </article>
  );
};




ReactDom.render(<BookList />, document.getElementById("root"));
